        }

        public void Write(Op op) {
            
            this.items[op.entityIndex] = op;
            this.exist[op.entityIndex] = true;

        }

        public bool Read(int index, out Op op) {

            if (this.exist[index] == true) {
                op = this.items[index];
                return true;
            }

            op = default;
